import React, {Component} from 'react';   
class Match extends Component {

    constructor(props){
        super(props)
        this.state = { 
            match:this.props.match
        }
     }
    
    render() { 
        const {match} = this.state;
        console.log(match);
        return (
            <div>
                    <h4> From Match Component...</h4> 
            </div>         
        );
    }
}
 
export default Match;
